import "./home.scss";
import Navbar from "../components/navbar/Navbar";
import Featured from "../components/featured/Featured";

const Home = () => {
  return (
    <div className="home">
        <Navbar/>
        <img src="https://upload.wikimedia.org/wikipedia/commons/0/0c/Netflix_2015_N_logo.svg" alt="logo"/>
        <Featured />
    </div>
  )
}

export default Home
